CREATE OR REPLACE FUNCTION alpine_miner_get_select_column_sql(table_name varchar(32672), column varchararray, where_condition varchar(32672))
returns varchar(32672)
begin
	declare sql varchar(32672) default ' ';
	declare column_sql varchar(32672) default ' ';
	declare column_count integer;
	declare i integer;
set column_count = CARDINALITY(column);
set i = 1;
while(i <= column_count) do
	if (i != 1) then
		set column_sql = column_sql || ' , ';
	end if;
	set column_sql = column_sql || column[i] || ' as c'||rtrim(char(i));
	set i = i + 1;
end while;

while ( i <= 1012) do
	set column_sql = column_sql ||' , '||' null as c'||rtrim(char(i));
	set i = i + 1;
end while;
set sql = 'select '||column_sql||' from '||table_name;
if where_condition is not null then
	set sql = sql||' '||where_condition;
end if;
return sql;
end@

