create or replace procedure PROC_DROPSCHTABLEIFEXISTS(schemaname varchar(4000),tablename varchar(4000)) 
LANGUAGE SQL

BEGIN 
 DECLARE v_count    integer;
 DECLARE  executesql varchar(4000);
  DECLARE stmt STATEMENT;
    DECLARE curs CURSOR FOR stmt;


	SET schemaname=substr(schemaname,2,length(schemaname)-2);
	SET tablename=substr(tablename,2,length(tablename)-2);
	SET executesql= ' select count(*)    from syscat.tables   where  tabschema= '''||schemaname||''' and tabname =  '''||tablename||''' ' ;
	
	PREPARE stmt FROM executesql;
        OPEN curs;
        FETCH FROM curs INTO v_count;
	
        CLOSE curs;

  if v_count > 0 then
	
   SET executesql = 'drop table "'||schemaname||'"."' || tablename || ' "';
    execute immediate executesql;
    commit;
	
 end if;
END@

