create or replace 
FUNCTION 
alpine_miner_trim_timestamp_string(timestamp_input timestamp)
returns varchar(32)
begin
declare i int default 1;
declare result varchar(32);
	if timestamp_input is null
	then
		return null;
	end if;
	set result = (timestamp_input);
	set result = substr(result, 1, 10)||' '||substr(result, 12, 2)||':'||substr(result, 15, 2)||':'||substr(result, 18, length(result) - 17);
	while ( '0'= substr(result, length(result), 1)  and  '.' != substr(result, length(result) - 1, 1) ) do
		set result = substr(result, 1,length(result) - 1);
	end while;
	return result;
end@


